  `leader_stock_change_percent` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '龙头股票涨跌幅',
  `up_numbe` int NULL DEFAULT NULL COMMENT '上涨家数',
  `down_numbe` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '下跌家属',
  `trade_date` date NULL DEFAULT NULL COMMENT '交易日',
